  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is one component of a digital
  orthophoto coverage (DOI) over Marion County, FL. This dataset is comprised of 3-band
  24-bit (red, green, and blue bands) DOI cells in a Geotiff format, at a 1-foot pixel
  resolution, based on the FL Statewide 5,000' x 5,000' tile system. This dataset
  was created from source imagery acquired for the FY2008 Levy and Marion County Digital
  Orthophoto Project using a Leica ADS40/ADS51 multispectral scanner. Multiple lift
  dates of January 14, 21, 25, 27, 28, 29 and February 10, 2008 were required to collect
  the cloud-free digital imagery. The companion dataset to this coverage includes
  a dataset comprised of the original imagery mosaic lines with dates of imagery acquisition
  in the ESRI shapefile format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
